def scoreFullBoard(block, player):
    str = ""
    for i in block:
        if i == 0:
            str += "0"  
        elif i == player:
            str += "1"
        else:
            str += "2"
    return data2[str]

def scoreBlock(block, player):
    str = ""
    for i in block:
        for j in i:
            if j == 0:
                str += "0"  
            elif j == player:
                str += "1"
            else:
                str += "2"
    return data[str]
        
def heuritic(cur_state, player):
    blocks = cur_state.blocks
    global_cells = cur_state.global_cells
    score = 0
    for block in blocks: 
        score += scoreBlock(block, player)
    score += scoreFullBoard(global_cells, player)
    return score

def minimax(depth, cur_state, isMaximizingPlayer, alpha, beta, player):
    valid_moves = cur_state.get_valid_moves
    if len(valid_moves) == 0 or depth >= MAX_DEPTH:
        return heuritic(cur_state, player)

    if isMaximizingPlayer:
        best = -INFINITY
        for valid_move in valid_moves:
            new_state = State(cur_state)
            try:
                new_state.act_move(valid_move)
            except:
                continue
        
            if len(valid_moves) > 9:
                val = minimax(depth + 2, new_state, not isMaximizingPlayer, alpha, beta, player)
            else:
                val = minimax(depth + 1, new_state, not isMaximizingPlayer, alpha, beta, player)
            
            best = max(best, val)
            alpha = max(alpha, best)
            if beta <= alpha: 
                break
        return best
    else:
        best = INFINITY
        for valid_move in valid_moves:
            new_state = State(cur_state)
            try:
                new_state.act_move(valid_move)
            except:
                continue
            
            if len(valid_moves) > 9:
                val = minimax(depth + 2, new_state, not isMaximizingPlayer, alpha, beta, player)
            else:
                val = minimax(depth + 1, new_state, not isMaximizingPlayer, alpha, beta, player)
            
            best = min(best, val)
            beta = min(beta, best)
            if beta <= alpha:
                break
        return best    
	

def select_move(cur_state, remain_time):
    valid_moves = cur_state.get_valid_moves
    num_valid_moves = len(valid_moves)
    
    if num_valid_moves == 0:
        return None

    best_value = -INFINITY
    best_move = np.random.choice(valid_moves)
    player = cur_state.player_to_move
        
    temp = 0
    win_blocks = len([np.where(cur_state.global_cells != 0)])
    num_step = len([np.where(cur_state.blocks != 0)])
    if win_blocks >= 2 or num_step > 20:
        temp = -1
    if win_blocks >= 4 or num_step > 40:
        temp = -2 
    
    for valid_move in valid_moves:
        new_state = State(cur_state)
        try:
            new_state.act_move(valid_move)
        except:
            continue
            
        if num_valid_moves > 40:
            value = minimax(temp + 6, new_state, False, -INFINITY, INFINITY, player)
        elif num_valid_moves > 30 and num_valid_moves <= 40:
            value = minimax(temp + 5, new_state, False, -INFINITY, INFINITY, player)
        elif num_valid_moves > 11 and num_valid_moves <= 30:
            value = minimax(temp + 4, new_state, False, -INFINITY, INFINITY, player)
        elif num_valid_moves > 9 and num_valid_moves <= 11:
            value = minimax(temp + 3, new_state, False, -INFINITY, INFINITY, player)
        elif num_valid_moves > 5 and num_valid_moves <= 9:
            value = minimax(temp + 2, new_state, False, -INFINITY, INFINITY, player)
        elif num_valid_moves > 3 and num_valid_moves <= 5:
            value = minimax(temp + 1, new_state, False, -INFINITY, INFINITY, player)
        else:
            value = minimax(temp + 0, new_state, False, -INFINITY, INFINITY, player)
        
        if value > best_value:
            best_value = value
            best_move = valid_move
            
    return best_move
